import React from 'react';
import whiteLogo from '../../styles/images/whiteLogo.png';
import 'primereact/resources/themes/saga-blue/theme.css';
import 'primereact/resources/primereact.min.css';
import '../../styles/css/layout.css';

const style = {
    main: {
        display: 'flex',
        flexDirection: 'column',
        height: '100%',
        width: '100%',
        background: '#ff773b'
    },
    navbar: {
        height: '10%',
        width: '100%',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center'
    },
    section: {
        height: '90%',
        width: '100%',
        display: 'flex',
        alignItems: 'center'
    },
    sidebar: {
        height: '92%',
        width: '168px',
        marginLeft: '63px',
        background: '#FB931A',
        borderRadius: '5px',
        display:'flex',
        alignItems:'center',
        flexDirection:'column'
    },
    content: {
        height: '92%',
        width: '83.3%',
        borderRadius: '5px',
        marginLeft: '45px',
        marginRight: '45px',
        background: '#FB931A',
    },
    buttonSide:{
        marginTop:'14px',
        borderRadius:'2px',
        display:'flex',
        justifyContent:'center',
        alignItems:'center',
        width:'90%',
        height:'40px',
        background:'#ff773b',
        cursor:'pointer',
        color:'#fff',
        fontFamily:'Lato',
        fontWeight:'600'
    }
}

const Layout = () => {
    return (
        <main style={style.main}>
            <section style={style.navbar}>
                <img src={whiteLogo} style={{ marginTop: '8px', height: '75px', width: '150px', marginLeft: '20px' }} alt="CNX Telecom - você sempre conectado!" />
            </section>
            <section style={style.section}>
                <aside style={style.sidebar} className='raised'>
                    <div style={style.buttonSide} className='raised'>Dashboard</div>
                    <div style={style.buttonSide} className='raised'>Telas</div>
                    <div style={style.buttonSide} className='raised'>Conteúdos</div>
                    <div style={style.buttonSide} className='raised'>Teste</div>
                    <div style={style.buttonSide} className='raised'>Teste</div>
                </aside>
                <div style={style.content} className='raised'>

                </div>
            </section>
        </main>
    )
}

export default Layout;
